import React from "react";

const Services = () => {
  const serviceList = [
    { emoji: "ü©∫", name: "Medical/Paramedical" },
    { emoji: "üõ†", name: "Engineering" },
    { emoji: "üíª", name: "Information Technology" },
    { emoji: "üìà", name: "Business & Management" },
    { emoji: "üëó", name: "Fashion Designing" },
    { emoji: "üëó", name: "Modeling" },
    { emoji: "üé®", name: "Arts & Design" },
    { emoji: "üßë‚Äçüè´", name: "Teacher" }
  ];

  return (
    <section id="services" className="services">
      <h2>Our Services</h2>
      <p><u>Admission/Placement</u></p>

      <div className="service-buttons">
        {serviceList.map((service, index) => (
          <button key={index} className="service-button">
            {service.emoji} {service.name}
          </button>
        ))}
      </div>
    </section>
  );
};

export default Services;
